* 찬 음료 전용','수국이 핀 제주도 풍경을 400ml 컵에 담은 3종 세트 상품입니다. 각각의 컵에는 제주도 방언으로 풍경을 표현한 문구가 적혀 있습니다. - 제주 곱들락 종달리 수국 : 곱게 핀 제주 종달리 수국- 제주 올레길 수국 드르 : 제주 올레길 수국 들판- 제주 돌담과 수국 자왈 : 제주 돌담과 수국 덤불자연 소재(대나무 섬유, 옥수수 전분 등)가 혼합되어 있어 색이 강한 음료로 인해 염착이 발생할 수 있으니 사용 시 주의하시기 바랍니다. 전용 박스에 담겨 있어 선물하기 좋습니다.* 재질의 특성상 고온의 열에 약하며, 열전도율이 높으니 찬 음료 전용으로 사용하시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/05/[9300000002532]_20200525093742721.jpg');
','서울의 노을 지는 하늘과 서울의 상징인 여러 조형물과 장소가 함께 디자인 된 상품입니다. 현대적인 건축과 전통의 문화유산들이 어우러져 있는 도시의 특징을 표현하고자 하였습니다. 가운데의 ‘서울 Seoul’ 글씨는 강병인 캘리그라퍼가 직접 제작한 캘리그라피 입니다. ',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2019/08/[9300000001745]_20190806105254881.jpg');
수국이 핀 제주도 풍경을 그려낸 473ml 용량의 텀블러입니다. ','수국이 핀 제주도 풍경을 그려낸 473ml 용량의 텀블러입니다. 스테인리스 스틸 재질의 텀블러이며, 이중벽 구조로 되어 있어 보온/보냉 효과가 우수한 상품입니다. 리드는 슬라이드 방식으로 여닫을 수 있습니다. 돌려 여닫을 때마다 리드 음용구의 부품이 오르락 내리락하면서 음료를 마실 수 있는 구조로 되어있기 때문에 스트로와 함께 사용이 불가한 점 참고 부탁드립니다.전용 박스에 담겨 있어 선물하기 좋습니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/05/[9300000002533]_20200518173540094.jpg');
* 제주도 지역 내 매장에서만 판매합니다.','제주의 특징적인 한라봉과 말의 모습을 담은 손수건 2종 세트입니다. 앞 면은 거즈, 후면은 타월 소재로 제작되었습니다.본 상품은 중성세제를 사용하여 30도의 물에 손 세척하시기 바라며, 세척 시 강한 자극은 인쇄 면을 손상시킬 수 있으니 주의하시기 바랍니다. 섬유유연제의 사용은 수분흡수력을 저하시키고 보풀 발생의 원인이 되므로 사용하지 않을 것을 권장합니다. 사용 중 이염이 발생할 수 있습니다. 다림질이 불가한 상품입니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2019/02/[9300000001863]_20190219134125298.jpg');
수국 자수가 곱게 놓인 활용도 높은 에코백 입니다.
','제주 수국을 표현한 에코백으로, 리넨 혼방 소재로 제작되어 하늘하늘한 분위기를 연출할 수 있습니다. 가방에 달려 있는 끈을 조여 주머니 모양으로 연출할 수 있습니다.다림질이 불가한 상품이며, 상품에 습기가 있는 상태에서 사용 시 이염이 발생할 수 있으므로 주의하시기 바랍니다. 사용 중 자수의 올 풀림이 발생할 수 있으니 주의하시기 바랍니다. 원단의 특성상 밝은 색상의 제품과 마찰 시 이염이 발생할 수 있으니 사용 시 주의하시기 바랍니다. 소재의 특성상 마찰 시 보풀이 발생할 수 있습니다.  오염 시에는 화학 약품을 사용하지 마시고 물 수건을 이용하여 톡톡 두드려 닦아낸 후 그늘에서 말려주시기 바랍니다.사이즈 : 가로 40cm x 세로 45cm (끈길이 제외)전용 박스에 담겨 있어 선물하기 좋습니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/05/[9300000002524]_20200512095534043.jpg');
* 제주도 지역 내 매장에서만 판매합니다.','제주 유채꽃을 표현한 에코백으로, 마 소재로 제작되어 하늘하늘한 분위기를 연출할 수 있습니다. 양쪽 끈을 에코백 안쪽을 향하게 하여 묶으면 작은 사이즈의 에코백으로도 연출 가능합니다.다림질이 불가한 상품이며, 상품에 습기가 있는 상태에서 사용 시 이염이 발생할 수 있으므로 주의하시기 바랍니다. 오염 시에는 화학 약품을 사용하지 마시고 물 수건을 이용하여 톡톡 두드려 닦아낸 후 그늘에서 말려주시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2018/02/[9300000000921]_20180221164318586.jpg');
수국이 핀 제주로 힐링여행을 떠난 베어리스타 키링입니다.','수국이 핀 제주로 배낭을 메고 힐링여행을 떠난 베어리스타 키링입니다.PU 재질의 연보라색 스트랩에 레터 로고가 매치되었습니다. *다른 상품과 마찰 시 이염이 발생할 수 있으니 사용에 주의하시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/05/[9300000002526]_20200512100759572.jpg');
수국이 활짝 핀 제주 풍경을 담은 스노우 글로브입니다.','수국이 활짝 핀 제주 풍경을 담은 스노우 글로브입니다. 글로브를 흔들면 꽃잎이 흩날리는 것과 같이 글리터가 연출이 됩니다. 유리 재질로 되어 있어 충격에 약하니 주의해 주세요. 장난감이 아니므로 13세 미만의 어린이가 사용하지 않도록 주의해 주세요.머그의 손잡이는 디자인일 뿐 손잡이용이 아니므로 상품을 들어 올릴 때 머그 핸들이 아닌 상품 전체를 들어 안전하게 사용해 주시기 바랍니다.전용 박스에 담겨 있어 선물하기 좋습니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/05/[9300000002528]_20200512102214988.jpg');
비오는 날의 제주 수국이 안쪽에 프린팅 된 3단 양산 겸용 우산입니다.','비 오는 날의 제주 수국이 안쪽에 프린트된 3단 양산 겸용 우산입니다. 가방에 쏙 넣어 다닐 수 있는 작은 사이즈와 가벼운 무게가 특징입니다. 우산은 UV 코팅이 되어 있어 양산으로도 사용 가능합니다. 파우치가 있어 우산 보관이 편리합니다.사이즈 : 55cm x 8K전용 원통 박스에 담겨 있어 선물하기 좋습니다.* 젖은 파우치는 꼭 펼쳐 말려주시고, 충분히 건조한 후 우산을 보관하시기 바랍니다. 젖은 상태에서 파우치를 보관할 시 파우치에서 악취 및 곰팡이가 발생할 수 있습니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/05/[9300000002525]_20200512102730601.jpg');
작은 소품을 넣을 수 있는 파우치형 키 체인입니다.','수국 참이 포인트로 달린 파우치 키 체인입니다. 배낭 모양의 파우치에는 이어폰 등 작은 소품을 넣을 수 있습니다. 본 제품은 완구가 아니며, 유 소아의 손이 닿지 않는 곳에서 보관 및 사용해 주세요.제품의 작은 부속품을 어린이가 삼키지 않도록 주의해 주세요.제품을 강하게 당기면 파손의 위험이 있으니 주의하시길 바라며, 귀중품이나 무거운 물건을 넣지 말아주세요. 봉제제품의 특성상 형태가 일정하지 않을 수 있으며, 이는 불량의 사유로 보기 어렵습니다.상품의 변형 우려가 있으니 세탁은 가급적 피해주시고, 표면에 얼룩이 발생하였을 경우 즉시 젖은 수건으로 닦아내시기 바랍니다.원단의 특성상 밝은 색상의 제품과 마찰시 이염이 발생할 수 있으니 사용 시 주의하시기 바랍니다. 사이즈 : 가로 6cm x 세로 6cm전용 박스에 담겨 있어 선물하기 좋습니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/05/[9300000002527]_20200512101828900.jpg');
이산화탄소(CO2)를 활용한 천연 디카페인 방식으로 카페인을 제거하여 기존 하우스 블렌드와 동일한 맛과 풍미를 가지고 있습니다.','깔끔하고 균형을 잘 이룸','너트, 애플, 블루베리',null,'https://image.istarbucks.co.kr/upload/store/skuimg/2017/09/[11059722]_20170921153534420.jpg');
9세기부터 존재해 온 고원의 화산 토양지대에서 자라난 아라비카 커피는 에티오피아에서부터 세계의 다른 여러 지역으로 긴 여행을 시작해 우리 곁으로 오게 되었습니다. 벨벳 같은 부드러움 질감과 후추 같은 스파이시함이 특징인 커피를 만나보세요.','수세식 가공 방식의 커피로 미디엄의 균형잡힌 강도와 감귤향의 커피','벨벳 같은 부드러운 질감과 후추 같은 스파이시함이 특징인 이 커피는 1971년 스타벅스가 처음 문을 연 이후 꾸준히 사랑 받아온 유니크하면서도 특별한 커피입니다.',null,'https://image.istarbucks.co.kr/upload/store/skuimg/2017/06/[11029237]_20170626182257204.jpg');
출근 열차를 타기 위해 몰려드는 수많은 사람들... 이들에게 더 빠른 시간안에 커피의 영혼을 잃지 않은 한 잔, 한 잔을 전하고자 이탈리아에서 에스프레소가 개발되었다고 합니다. 이후 지금은 이탈리아를 넘어 전 세계의 커피 애호가들에게 에스프레소는 오랜시간 천천히 음미할 수 있는 마법과도 같은 순간을 만들어 주고 있습니다. 지금 이 순간에도 여전히 한잔의 에스프레소가 또 한 분의 고객님을 위해 내려지고 있습니다.','강한 바디감과 캬라멜 향','출근길 빠른 걸음으로 크로와상과 함께.',null,'https://image.istarbucks.co.kr/upload/store/skuimg/2015/07/[11017024]_20150722231935988.jpg');
