스타벅스에서 많은 사랑을 받고 있는 카페 모카를 이제 VIA로 만나실 수 있습니다. Micro ground 공법을 이용하여 만들어진 100% 아라비카 커피에 천연 코코아, 그리고 우유를 담아 만들어진 VIA Caffe Mocha는 우리의 일상을 더욱 풍부하고 즐겁게 만들어 줄 것입니다. 언제 어디서든 우유 없이도, 따뜻한 물만 있다면 깊고 풍부한 맛의 카페 모카를 즐기실 수 있습니다.','깊고 풍부한 모카','브라우니, 초콜릿 피칸 타르트',null,'https://image.istarbucks.co.kr/upload/store/skuimg/2018/10/[11087641]_20181010170423737.jpg');
스타벅스에서 많은 사랑을 받고 있는 바닐라 라떼를 이제 VIA로 만나보세요. Micro ground 공법을 이용하여 만들어진 100% 아라비카 커피에 달콤한 바닐라향의 시럽과 우유를 담아 만들어진 VIA Vanilla Latte는 모든 일상을 부드러움과 달콤함으로 물들게 할 것입니다. 언제 어디서든 우유 없이도, 따뜻한 물만 있다면 부드럽고 달콤한 바닐라 라떼를 즐기실 수 있습니다.','달콤한 바닐라의 부드러움','커스터드 바닐라 혼',null,'https://image.istarbucks.co.kr/upload/store/skuimg/2018/10/[11087636]_20181010170343169.jpg');
