Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000001566','머그','청담스타 화이트 머그 296','mlChengdam star white mug 296ml',null,'TC09','1146',null,null,null,null,'N','Y',19000,null,null,null,null,null,null,'N','청담스타R점 전용 상품','깔끔한 1자 쉐입에 음각 사이렌 로고가 더해져 고급스러움을 자아냅니다. 머그 전체에 1000th STARBUCKS STORE 타이포가 사이렌 로고와 어우러지게 디자인 되었습니다.머그 내부에 보이는 라인이나 핸들 접착 부분에 보이는 홈은 제조 공정 상 발생하는 부분으로, 이는 불량이 아닙니다. 본 머그는 전자레인지 사용이 불가합니다. 세척 시에는 손 세척해 주시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2018/12/[9300000001566]_20181212171053157.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000000884','머그','코리아 데미머그 세트(4개입)','Korea demi mug set(4ea)',null,null,null,null,null,null,null,'N','Y',33000,null,null,null,null,null,null,'N','상시 판매 상품','한국의 전통 문양과 고유의 문화를 표현 한 데미머그 세트입니다. 각각 다른 디자인의 데미머그 4개가 구성된 세트 상품으로, 기 출시 된 코리아 머그 중 인기가 많았던 상품들을 데미머그 사이즈로 재 디자인하였습니다. 패키지에 손잡이가 있어 선물하기 좋으며, 외국인 고객들에게 기념품으로 추천하기 좋습니다. 패키지 뒷면에 각 머그에 대한 소개가 국문/영문으로 기재되어 있습니다.탈춤 머그를 제외한 3종은 전자레인지 사용 불가 제품입니다.<데미머그 4종 소개>탈춤 머그 - 한국의 전통 가면 무용인 ''탈춤''을 디자인 한 데미머그입니다.단청 머그 - 한옥 지붕에 주로 사용되는 아름다운 단청을 모던하게 디자인 한 데미머그 입니다.8.15 머그 - 화접화(꽃과 나비가 있는 한국화)의 소재와 구도를 사용하여 디자인 한 데미머그입니다. 훈민정음 머그 - 세종대왕이 창제한 우리나라 말, 훈민정음 해례본 첫 머리에 기록되어 있는 훈민정음의 창제 이유를 머그에 그대로 담았습니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2017/09/[9300000000884]_20170921155042633.jpg');
