Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000002824','머그','환구단 스퀘어 머그 355','mlHwangudan square mug 355ml',null,null,null,null,null,null,null,'N','Y',15000,null,null,null,null,null,null,'N','대한제국 선포의 날을 기념하여 매화가 아름답게 놓인 따스한 봄날의 환구단을 표현한 355ml 용량의 세라믹 머그입니다. ','환구단은 고종황제께서 1897년 10월 12일에 하늘에 제사를 지낸 후 황제로 즉위하며 대한 제국을 선포했던 장소로, 현존하는 환구단의 황궁우 내부 벽면에 새겨진 매화 그림을 재현한 톨 사이즈의 세라믹 머그입니다.본 상품은 전자레인지와 식기세척기 사용이 가능하며, 앞면에는 스타벅스 로고와 환구단 레터를, 뒷면에는 일러스트를 새긴 양 방향 디자인으로 특별함을 더했습니다.리빙 코랄의 컬러 배색으로 대한제국 선포의 날의 희망적인 분위기를 표현하였으며 하단 그라운드는 골드 컬러를 사용하여 고귀함이 돋보이는 상품입니다.환구단 MD 판매 수익금은 독립문화유산 보호 기금으로 후원합니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/09/[9300000002824]_20200924083515112.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000002478','머그','스타벅스 1호점 핸들 글라스 502','mlStarbucks the first handle glass 502ml',null,'TC09','149',null,null,null,null,'N','Y',23000,null,null,null,null,null,null,'N','이대R 매장 전용 상품','이대의 이름이 유래된 배꽃과 스타벅스의 분위기가 어우러진 글라스입니다. 뜨거운 음료 사용도 가능한 내열 글라스이오나, 화상의 위험이 있으므로 찬 음료 전용으로 사용하시길 추천드립니다.혹 뜨거운 음료를 이용할 시에는 핸들을 잡고 사용해 주시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/05/[9300000002478]_20200513101116318.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000002056','머그','어뮤즈먼트 파크 시온 글라스 머그 470','mlAmusement park color changing glass mug 470ml',null,'TC06','1514',null,null,null,null,'N','Y',18000,null,null,null,null,null,null,'N','스타벅스 용인에버랜드R점 전용 상품','차가운 음료를 담으면 대관람차 부분의 도트가 아름다운 컬러로 변하는 시온 글라스로 유니크한 글라스 머그 상품입니다. 상품 특성상 컬러가 변하는 속도와 정도는 사용자 환경에 따라 달라질 수 있으니 사용시 주의하여 주시기 바랍니다. *차가운 음료 전용 상품입니다. *음료가 담긴 상태에서 아이스를 넣어주시기 바라며, 충격에 의하여 제품 손상이 될 수 있으니 주의하시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2019/08/[9300000002056]_20190813103127572.jpg');
