Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P11117125','글라스','20 홀리데이 점핑 도그 글라스 콜드컵 355','ml20 Holiday jumpingdog glass coldcup 355ml','TC01',null,null,null,null,null,null,'Y','Y',21000,null,null,null,null,null,null,'Y','홀리데이를 즐기는 반려동물 일러스트의 귀여움이 돋보이는 355ml 용량의 글라스 콜드컵으로, 2020 크리스마스1 프로모션 상품입니다.','글라스 바디와 강아지 모양의 실리콘 리드가 조화롭게 디자인 된 톨 사이즈 글라스 콜드컵입니다. 홀리데이를 즐기는 반려동물의 발랄함을 표현하여 더욱 사랑스러운 분위기를 자아냅니다. 차가운 음료 전용 상품이며 얼음이 들어간 음료를 드실 경우에는 얼음에 의한 충격으로 글라스가 파손될 수 있으니 음료를 먼저 부은 다음 얼음을 넣어 주시기 바랍니다. 금속 재질의 스푼 혹은 머들러의 사용은 삼가 하시기 바랍니다. 실리콘 리드는 재질 및 컬러 특성상 먼지가 쉽게 달라 붙을 수 있으므로 참고하시기 바랍니다.본 상품은 전자레인지, 식기세척기 사용이 불가하며 글라스 재질 특성상 약한 충격에도 파손될 수 있으니 주의하시기 바랍니다.*리드는 실리콘 재질로 열탕 소독 시 변형 및 변색 될 수 있으니 삼가시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/10/[11117125]_20201020075835733.jpg');
