Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P11117119','플라스틱 텀블러','20 크리스마스 트리 텀블러 473','ml20 Christmas tree tumbler 473ml','TC01',null,null,null,null,null,null,'Y','Y',18000,null,null,null,null,null,null,'Y','크리스마스의 분위기가 돋보이는 473ml 용량의 플라스틱 텀블러로, 2020 스타벅스 크리스마스1 프로모션 상품입니다.','홀리데이를 즐기는 귀여운 반려동물의 컨셉으로 귀여움이 돋보이며, 홀리데이의 분위기가 잘 드러나는 빈티지 소파 모양의 참 장식이 포인트인 그란데 사이즈의 플라스틱 텀블러입니다.본 상품은 입구가 넓어 세척이 용이하며 플라스틱 재질로 가벼움이 특징입니다. 또한 이중벽 구조로 되어 있어 결로 현상 없이 편리하게 사용할 수 있습니다.빈티지 소파를 표현한 참 장식은 얼룩처럼 보일 수 있으나, 이는 의도된 디자인으로 불량이 아닙니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/10/[11117119]_20201027101429202.jpg');
