Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000002724','스테인리스 텀블러','20 SS 화이트 뉴포트 텀블러 355ml','20 SS White newport tumbler 355ml','TC01',null,null,null,null,null,null,'Y','Y',32000,null,null,null,null,null,null,'Y','355ml 용량의 뉴포트 텀블러로, 화이트 크리스마스의 분위기를 담은 2020 크리스마스 1 프로모션 상품입니다.','화이트 크리스마스의 분위기를 담은 톨 사이즈의 뉴포트 텀블러입니다.상단의 리드를 분리하면 티 스트레이너가 내장되어 있어 외부에서도 티타임을 즐길 수 있으며, 손잡이가 있어 책상에 두고 사용하기에 용이합니다.뉴포트 텀블러는 스테인리스 스틸 재질의 이중벽 구조로 되어 있어 보온, 보냉 효과가 우수합니다.*티 스트레이너는 별도 판매되지 않으니 취급에 주의하시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/10/[9300000002724]_20201020080422164.jpg');
