Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000001758','스테인리스 텀블러','SS 경주 투어 텀블러 355ml','SS Gyeongju tour tumbler 355ml','TC02',null,null,null,null,null,null,'N','Y',33000,null,null,null,null,null,null,'N','경주 시티 상품','벚꽃이 흐드러지는 봄의 경주를 디자인 한 상품입니다. 도시 전체가 박물관인 경주를 나타내기 위해 다양한 유물 및 유적지를 수채화 느낌으로 표현하였고, 특히 첨성대 위에는 별 등을 함께 그려 넣어 신비로운 경주를 나타내었습니다. 가운데의 ‘경주 Gyeongju’ 글씨는 강병인 캘리그라퍼가 직접 제작한 캘리그라피 입니다. ',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2019/08/[9300000001758]_20190806110838045.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000001768','스테인리스 텀블러','SS 루시 레터 슬리브 텀블러 355ml','SS lucy letter sleeve tumbler 355ml',null,null,null,null,null,null,null,'N','Y',27000,null,null,null,null,null,null,'N','시즌에 구애받지 않는 화이트 컬러에 돌려 여는 리드가 매치된 스테인리스 텀블러','시즌에 구애받지 않는 화이트 컬러에 돌려 여는 리드가 매치된 스테인리스 루시 텀블러입니다. 바디가 오목하여 잡기 편하고, 중간에 실리콘 슬리브가 있어 미끄럽지 않습니다. 중간 마개가 있어 얼음이나 티백이 나오는 것을 방지해 줍니다.* 리드 표면은 소재와 마감의 특성 상 오염물질이 끼기 쉬우니 사용 및 세척 시 유의해 주시기 바랍니다.* 텀블러 표면은 매트하게 디자인되어 유광 디자인의 상품보다 스크래치 발생이 비교적 쉽습니다. 세척 및 사용 시 유의해 주시기 바랍니다. ',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2019/10/[9300000001768]_20191016142542019.jpg');
