Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000001046','스테인리스 텀블러','SS 엘마 클래식 화이트 텀블러 355ml','SS Elma classic white tumbler 355ml',null,null,null,null,null,null,null,'N','Y',31000,null,null,null,null,null,null,'N','견고한 구조의 스테인리스 스틸 소재 텀블러','깔끔한 크림색 바탕의 톨 사이즈 스테인리스 스틸 재질의 텀블러입니다. 사이렌 로고를 음각으로 표현하였고 바닥면을 글로시한 로즈골드 컬러로 세련되게 마무리하였습니다. ',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2018/02/[9300000001046]_20180221165114877.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000001763','스테인리스 텀블러','SS 우리나라 도자 텀블러 355ml','SS Korea doja tumbler 355ml',null,null,null,null,null,null,null,'N','Y',34000,null,null,null,null,null,null,'N','상시 판매 상품','표면에 은은한 펄을 넣어 더욱 고급스러운 스테인리스 텀블러입니다. 리드의 실리콘 손잡이에 문양을 넣어 한국적인 분위기를 자아냅니다. 상품에 그려진 청자와 백자는 실제 현존하는 유물이며, 국내 박물관 및 미술관 등에서 만나실 수 있습니다. 자세한 정보는 텀블러에 동봉된 자료를 참고해 주시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/02/[9300000001763]_20200221093045825.jpg');
