Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000002823','스테인리스 텀블러','SS 환구단 트로이 텀블러 473ml','SS Hwangudan troy tumbler 473ml',null,null,null,null,null,null,null,'N','Y',33000,null,null,null,null,null,null,'N','대한제국 선포의 날을 기념하여 매화가 아름답게 놓인 따스한 봄날의 환구단을 표현한 473ml 용량의 스테인리스 스틸 텀블러입니다.','환구단은 고종황제께서 1897년 10월 12일에 하늘에 제사를 지낸 후 황제로 즉위하며 대한 제국을 선포했던 장소로, 현존하는 환구단의 황궁우 내부 벽면에 새겨진 매화 그림을 재현한 텀블러입니다.리빙 코랄의 컬러 배색으로 대한제국 선포의 날의 희망적인 분위기를 표현하였으며, 하단 그라운드는 골드 컬러를 사용하여 고귀함이 돋보이는 상품입니다.SS 환구단 트로이 텀블러는 넉넉한 그란데 사이즈의 스테인리스 스틸 재질로, 이중벽 구조 사이가 진공처리되어 보온/보냉 효과가 우수합니다.리드 특성상 빨대 이용이 어려우며, 매트한 마감으로 생활 스크래치에 주의하시기 바랍니다.환구단 MD 판매 수익금은 독립문화유산 보호 기금으로 후원합니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/09/[9300000002823]_20200924083218312.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000002416','스테인리스 텀블러','SS 그린 처비 핸들 텀블러 473ml','SS green chubby handle tumbler 473ml',null,null,null,null,null,null,null,'N','Y',36000,null,null,null,null,null,null,'N','핸들이 있는 스테인리스 스틸 텀블러','스타벅스커피코리아에서 처음 출시되는 모델의 텀블러로서 핸들이 있어 실용적입니다. 그린 컬러의 매트한 마감에 사이렌 로고가 더해진 디자인 상품입니다. 뚜껑은 오염 차단의 기능이 있을뿐 밀폐 기능을 갖추고 있지 않습니다. 테이블 및 데스크에서 사용하시길 권장합니다. 부품은 별도 구매가 어려우므로 취급에 유의하시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/04/[9300000002416]_20200422151619003.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000001033','스테인리스 텀블러','SS 블랙 헤리티지 뉴턴 텀블러 355ml','SS Black heritage newton tumbler 355ml',null,null,null,null,null,null,null,'N','Y',31000,null,null,null,null,null,null,'N','견고한 스테인리스 스틸 소재의 텀블러에 손잡이와 리드가 매치된 상품','절제된 블랙에 골드색의 헤리티지 로고를 멋스럽게 디자인 한 뉴턴 텀블러입니다. 사각 손잡이를 매치하여 시크한 느낌을 주며 리드 상단에 사이렌 로고를 음각으로 새겨 고급스러움을 더했습니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2018/01/[9300000001033]_20180103131527602.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P11065291','스테인리스 텀블러','SS 리저브 블랙 콜드컵 473ml','SS reserve black coldcup 473ml','TC03',null,null,null,null,null,null,'N','Y',33000,null,null,null,null,null,null,'N','스타벅스 리저브™ 매장 전용 상품','플라스틱 빨대가 매치된 스테인리스 스틸 리저브 콜드컵입니다. 정면 하단부에는 리저브 로고가 양각으로 표시되어 있으며, 후면에는 레이저로 리저브 레터 로고를 새겼습니다. 전자레인지 사용이 불가하며, 손 세척해 주시기 바랍니다. 찬 음료 전용 상품입니다. 이중 벽 구조이지만 진공 마감 처리가 되지 않아 표면 결로 현상이 발생할 수 있습니다. ',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2019/05/[11065291]_20190514171905322.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000002609','스테인리스 텀블러','SS 블랙 앤 골드 콜드컵 591ml','SS black&gold coldcup 591ml',null,null,null,null,null,null,null,'N','Y',34000,null,null,null,null,null,null,'N','우아함과 기품이 느껴지는 블랙과 골드 컬러의 조화로 계절과 성별에 구애받지 않고 사용할 수 있는 심플한 디자인의 벤티 사이즈 스테인리스 콜드컵입니다.','반 무광의 블랙 바디와 유광의 골드 리드로 마감 표현 방식에 차이를 둔 감각적인 상품입니다. 바디에는 사이렌 로고가 음각으로 새겨져 있으며, 리드는 은은한 골드 펄로 표현되어 디테일의 완성도를 높였습니다. SS 블랙 앤 골드 콜드컵은 입구가 넓어 세척이 편리하며 591ml의 넉넉한 용량을 지니고 있습니다. 본 상품은 스테인리스 스틸 소재의 찬 음료 전용인 콜드컵이며, 전자레인지와 식기세척기 사용이 불가합니다.이중벽 구조이기는 하나 내벽이 진공상태가 아니므로 보냉력이 보온병에 비해 떨어질 수 있으며, 내외부 온도차가 큰 경우 표면에 결로가 발생할 수 있습니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/09/[9300000002609]_20200918105804274.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000001767','스테인리스 텀블러','SS 블랙 헤리티지 터커 콜드컵 473ml','SS Black heritage tucker coldcup 473ml',null,null,null,null,null,null,null,'N','Y',33000,null,null,null,null,null,null,'N','시크한 블랙 컬러의 스테인리스 스틸 바디에 고무 밴드가 있어 사용하기 편리한 콜드컵','시즌에 구애 받지 않는 심플한 블랙과 골드 컬러로 디자인 된 스테인리스 스틸 재질의 텀블러입니다. 몸체는 스테인리스, 빨대는 PETG 소재로 되어 있으며, 중간에 고무 밴드가 있어 손으로 잡았을 때 흔들림 없이 사용할 수 있습니다. 뜨거운 음료를 넣어도 무방하나, 빨대로 마시는 형태이므로 화상 방지를 위해 아이스 음료 전용으로 사용하시기를 권고 드립니다. ',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2019/08/[9300000001767]_20190809134952721.jpg');
