Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000002744','악세서리','20 홀리데이 애프터눈 티 세트','20 Holiday afternoon tea set','TC01',null,null,null,null,null,null,'Y','Y',32000,null,null,null,null,null,null,'Y','첫 출시하는 애프터 눈 티 세트로, 소중한 이들과 함께하는 연말 홈 파티를 특별하게 완성시켜줄 2020 크리스마스1 프로모션 상품입니다.','스타벅스 코리아에서 처음으로 선보이는 애프터 눈 티 세트로, 소중한 이들과 함께하는 연말 홈 파티에 적합한 상품입니다.  홀리데이 애프터 눈 티 세트는 구매 후 조립이 필수이며, 조립 방법과 관련된 내부 삽지가 포함되어 있습니다.본 상품은 전자레인지 사용이 불가하며, 사용하기 전 반드시 취급 주의사항 내용을 숙지해 주시기 바랍니다. *부품은 별도 판매되지 않으니 취급에 주의하시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/10/[9300000002744]_20201020105347170.jpg');
