Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000002504','악세서리','코르크 코스터 세트','Cork coaster set',null,null,null,null,null,null,null,'N','Y',7800,null,null,null,null,null,null,'N','나무껍질을 활용한 코르크로 제작된 비거니즘 상품으로, 2개가 세트인 코스터입니다.','식물성 가죽인 코르크로 제작된 심플하면서도 감각적인 디자인이 돋보이는 가로 100 * 세로 100 (mm) 사이즈의 코스터 세트입니다.2개가 세트인 상품으로 블랙과 그린 컬러로 디자인되었으며, 양면으로도 사용이 가능하여 실용도가 높습니다.재질 특성상 마찰 시 코르크 탈락 현상이 발생할 수 있으며, 물이 닿았을 경우 오랜 사용을 위해 사용하신 후 수건을 이용하여 물기를 완전히 제거하시기 바랍니다.사용 기간에 따라 소재가 갈라질 수 있으며 이는 재질 특성에 따라 나타나는 것으로 불량이 아닙니다.코르크 면은 재질의 특성상 약간 울퉁불퉁할 수 있으며 인쇄면이 고르지 않을 수 있습니다.사용하기 전 반드시 취급 주의사항 내용을 숙지해 주시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/10/[9300000002504]_20201013112103232.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000001760','악세서리','경주 투어 미니백','Gyeongju tour mini bag','TC02',null,null,null,null,null,null,'N','Y',18000,null,null,null,null,null,null,'N','경주 시티 상품','벚꽃이 흐드러지는 봄의 경주를 디자인 한 상품입니다. 도시 전체가 박물관인 경주를 나타내기 위해 다양한 유물 및 유적지를 수채화 느낌으로 표현하였고, 특히 첨성대 위에는 별 등을 함께 그려 넣어 신비로운 경주를 나타내었습니다. 가운데의 ‘경주 Gyeongju’ 글씨는 강병인 캘리그라퍼가 직접 제작한 캘리그라피 입니다.  핸들과 길이 조절이 가능한 스트랩이 함께 달려 있어 크로스 백으로 활용이 가능합니다. 내부에는 주머니가 있어 실용도를 높였으며, 크기 및 디자인 상 여성 고객에 더 잘 매치되는 상품입니다.  ',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2019/08/[9300000001760]_20190801132033454.jpg');
