Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P11062168','악세서리','리저브 블랙 에코백','Reserve black ecobag','TC03',null,null,null,null,null,null,'N','Y',21000,null,null,null,null,null,null,'N','스타벅스 리저브™ 매장 전용 상품','캔버스 재질의 에코백입니다. 사이즈는 가로 약 36 * 세로 40 * 폭 13cm이며, 약 28cm 높이의 어깨 끈이 있습니다. 투 톤의 블랙 컬러에 리저브 로고가 매치되어 깔끔하고 심플한 디자인입니다. 내부는 코팅 처리가 되어 오염에 비교적 강합니다. 세탁이 불가하므로 에코백 오염 시에는 젖은 헝겊으로 톡톡 두드려 닦아내시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2019/05/[11062168]_20190514171622918.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P11091483','악세서리','리저브 블루 카드 홀더','Reserve blue card holder','TC03',null,null,null,null,null,null,'N','Y',23000,null,null,null,null,null,null,'N','스타벅스 리저브™ 매장 전용 상품','리저브로 선보이는 클래식한 카드 홀더입니다. 외부 양측과 중간부에 카드를 수납할 수 있는 공간이 있습니다. 리얼 가죽 소재로 제작되어 상품마다 주름의 정도가 상이할 수 있습니다. 오염 시에는 마른 헝겊으로 두드려 닦아내시기 바랍니다.* 스타벅스 리저브™ 매장에 한하여 판매됩니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2019/04/[11091483]_20190422142403576.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000001750','악세서리','부산 투어 미니백','Busan tour mini bag','TC02',null,null,null,null,null,null,'N','Y',18000,null,null,null,null,null,null,'N','부산 시티 상품','밤 하늘의 불꽃처럼 화려한 관광의 도시, 부산을 소개하는 상품입니다. 대한민국에서 손꼽히는 관광 도시임을 나타내기 위해 화려한 분위기로 디자인 하였으며, 이와 함께 외국인들이 주로 찾는 감천문화마을을 아기자기 하게 표현하였습니다. 가운데의 ‘부산 Busan’글씨는 강병인 캘리그라퍼가 직접 제작한 캘리그라피 입니다. 핸들과 길이 조절이 가능한 스트랩이 함께 달려 있어 크로스 백으로 활용이 가능합니다. 내부에는 주머니가 있어 실용도를 높였으며, 크기 및 디자인 상 여성 고객에 더 잘 매치되는 상품입니다. ',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2019/08/[9300000001750]_20190801131934727.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P11111822','악세서리','빈 데어 코리아 에코백','Been there korea ecobag',null,null,null,null,null,null,null,'N','Y',17000,null,null,null,null,null,null,'N','상시 판매 상품','한복, 하회탈, 첨성대, 부채춤, 비빔밥 등 한국의 문화적 키워드가 디자인 요소로 사용된 컨버스 에코백입니다. 사이즈는 가로 약 36cm X 세로 약 40cm이며, 손잡이가 큼직하고 가방 하단에 폭이 있어서 실용적으로 사용하실 수 있습니다. 세탁이 불가하므로 오염 즉시 해당 부분만 젖은 수건으로 톡톡 두드려 닦아주시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/01/[11111822]_20200131153730555.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000001747','악세서리','서울 투어 에코백','Seoul tour ecobag','TC02',null,null,null,null,null,null,'N','Y',16000,null,null,null,null,null,null,'N','서울 시티 상품','서울의 노을 지는 하늘과 서울의 상징인 여러 조형물과 장소가 함께 디자인 된 상품입니다. 현대적인 건축과 전통의 문화유산들이 어우러져 있는 도시의 특징을 표현하고자 하였습니다.안에는 주머니가 달려있어 실용성을 높였으며, 가방에 달려있는 고리는 탈부착이 가능하여 키체인으로도 활용이 가능합니다. ',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2019/08/[9300000001747]_20190801125703698.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000002111','악세서리','스타벅스 1호점 랩탑 파우치','Starbucks the first store laptop pouch',null,'TC09','149',null,null,null,null,'N','Y',17000,null,null,null,null,null,null,'N','이대R 매장 전용 상품','학생들의 필수템, 랩탑 파우치를 스타벅스에서 처음 선보입니다. 1호점 에코백과 유사한 컨셉으로 제작되어 2개를 같이 사용하여도 잘 어울립니다. 17인치 랩탑까지 잘 들어가는 크기로 제작되었으며, 파우치 특성 상 손잡이가 없으므로 고리를 달아 휴대가 비교적 편하게 되어 있습니다. 후면 주머니 안에는 볼펜이나 간단한 마우스 정도 넣을 수 있게 공간 분리가 되어 있으며, 파우치 내부에는 도톰한 충격 흡수재가 있어 안전하게 랩탑을 휴대할 수 있습니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2019/07/[9300000002111]_20190716144731137.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000002110','악세서리','스타벅스 1호점 에코백','Starbucks the first store ecobag',null,'TC09','149',null,null,null,null,'N','Y',24000,null,null,null,null,null,null,'N','이대R 매장 전용 상품','대학생들이 주로 들고 다니는 랩탑이나 대학 전공 서적들이 충분히 들어갈 수 있는 적당한 사이즈의 에코백으로, 캔버스 면 소재로 제작되어 표면이 부드럽습니다. 스타벅스커피 코리아 1호점이 있는 동네인 이대를 상징하는 배꽃과 스타벅스 사이렌 로고가 가방 고리로 달려있으며, 고리만 따로 빼서 키체인으로 활용할 수 있습니다. ',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2019/07/[9300000002110]_20190716144615034.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000001660','악세서리','스튜던트 투웨이 에코백','Student two-way eco bag',null,null,null,null,null,null,null,'N','Y',35000,null,null,null,null,null,null,'N','숄더백 혹은 백팩, 2가지 타입으로 활용이 가능한 에코백입니다. ','내/외부에 수납공간이 존재하며, 내부에는 노트북을 수납할 수 있도록 충격 방지용 패드가 동봉된 공간이 마련되어 있습니다. 에코백의 고리를 가방 하단의 고리에 연결하면 백팩으로 사용할 수 있으며, 손잡이는 사용자의 편의를 고려하여 길이 조절이 가능하도록 제작하였습니다. 캔버스 재질에 손잡이는 천연 가죽으로 제작되어 견고합니다. 가방 끈은 재질 특성 상 세탁이 불가하며, 끈 제외 후 에코백 본체 세탁은 가능합니다. 이 경우 미온수가 아닌 찬물에서 중성세제를 사용하여 단독 손세탁하시고, 가죽에 영향을 줄 수 있으므로 물에 오랜 시간 담가놓지 마십시오. 세탁 후에는 그늘에서 건조해 주시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2019/02/[9300000001660]_20190226124901434.jpg');
