Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P11077766','악세서리','리저브 우드 트레이','Reserve wood tray','TC03',null,null,null,null,null,null,'N','Y',37000,null,null,null,null,null,null,'N','스타벅스 리저브™ 매장 전용 상품','리저브로 선보이는 클래식한 우드 트레이로서 리저브 로고가 새겨져 있습니다. 사이즈는 가로 약 30*세로 17.5cm으로 머그 1-2잔 혹은 머그 1잔과 다과 플레이트를 올려놓기에 좋은 사이즈입니다. 액체가 묻은 상태에서 건조가 완벽하지 않을 시 갈라짐 및 뒤틀림의 원인이 될 수 있습니다. 오염 시에는 마른 헝겊으로 두드려 닦아내시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2019/05/[11077766]_20190514172034460.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000002615','악세서리','스타벅스 리유저블 스트로 세트','Starbucks reusable straw set',null,null,null,null,null,null,null,'N','Y',18000,null,null,null,null,null,null,'N','실리콘 스트로 3종과 세척솔, 린넨 파우치로 구성된 세트 상품','실리콘 스트로 3종과 세척솔, 린넨 파우치로 구성된 세트 상품으로서 찬 음료 전용입니다.스트로 3종은 그란데 음료용/벤티 음료용/프라푸치노용 스트로로 구성되어 있으며, 개인의 텀블러 스트로 홀의 지름에 따라 호환되지 않을 수 있으니 사용 시 주의하시기 바랍니다.실리콘 소재의 특성 상 파우치 보관 중 먼지나 이물질이 붙기 쉬우므로 사용 전 반드시 중성세제와 솔을 사용하여 세척 후 사용하시기 바랍니다. 매 사용 전에도 흐르는 물에 세척 후 사용을 권장합니다.사용 전후에는 세척솔을 사용하여 세척하며, 보관 시 완전 건조하여 보관하시기 바랍니다.파우치는 세탁이 불가합니다. 오염 즉시 젖은 수건으로 톡톡 두드려 닦아 주시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/10/[9300000002615]_20201007140436517.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000001661','악세서리','스튜던트 가죽 펜슬 케이스','Student leather pencil case',null,null,null,null,null,null,null,'N','Y',18000,null,null,null,null,null,null,'N','스튜던트 시리즈의 가죽 펜슬 케이스입니다.','필기도구 등을 보관하는 가죽 펜슬 케이스로서 말아서 가죽 끈으로 고정하는 형태입니다. 외부는 사이렌 로고가 디자인되었으며, 내부는 수납공간과 키를 달 수 있는 고리로 구성되어 있습니다.본 상품은 천연 가죽 제품으로 세탁이 불가합니다. 표면에 얼룩이 발생하였을 시 마른 수건으로 즉시 닦아내시기 바랍니다. 가죽 재질의 특성 상 주름의 크기는 상품마다 상이하며 사용 중 자연스러운 주름과 변색이 생길 수 있습니다. 가죽 끈은 사용 중에 늘어지거나 변형이 발생될 수 있으며, 과도하게 당길 시 파손될 수 있으니 사용 시 주의하시기 바랍니다. 또한 가죽 끝은 후가공없이 절단되어 사용 중 가루가 생길 수 있습니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2019/02/[9300000001661]_20190226133459531.jpg');
