Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000002405','악세서리','코르크 사이렌 슬리브','Cork siren sleeve',null,null,null,null,null,null,null,'N','Y',11000,null,null,null,null,null,null,'N','나무껍질을 활용한 코르크로 제작된 비거니즘 상품으로, 다회용 슬리브입니다.','식물성 가죽인 코르크로 제작된 심플하면서도 감각적인 디자인이 돋보이는 가로 88 * 세로 56 (mm) 사이즈의 슬리브입니다.사이렌 로고를 포인트로 매치하였으며, 후면에는 고무밴드가 있어 다양한 사이즈의 컵에 끼워 사용할 수 있습니다. (모든 컵과 텀블러에 맞지 않을 수 있으며, 구매 전 반드시 사이즈를 확인해 주시기 바랍니다.)뜨거운 음료가 담긴 상태에서 사용 시 화상에 주의하시기 바랍니다.사용기간에 따라 고무의 탄성은 약해질 수 있으며 이는 자연스러운 현상으로 불량이 아닙니다.재질 특성상 마찰에 의한 손상, 마모, 보풀 발생에 유의하시기 바랍니다.사용하기 전 반드시 취급 주의사항 내용을 숙지해 주시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/10/[9300000002405]_20201013111902431.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000002356','악세서리','코르크 헤리티지 북마크','Cork heritage bookmark',null,null,null,null,null,null,null,'N','Y',6800,null,null,null,null,null,null,'N','나무껍질을 활용한 코르크와 재생 가죽으로 제작된 비거니즘 상품으로, 심플한 디자인의 북마크입니다.','코르크와 재생 가죽을 활용한 가로20 * 세로125 (mm) 사이즈의 북마크로 심플하면서도 감각적인 디자인이 돋보이는 상품입니다.스타벅스를 상징하는 그린 컬러의 재생 가죽이 상단에 포인트로 있으며 은은한 골드 컬러의 레터 로고가 새겨진 북마크입니다.재질 특성상 마찰 시 코르크 탈락 현상이 발생할 수 있으며, 무리하게 사용할 경우 파손 및 변형이 일어날 수 있으니 주의하시기 바랍니다.사용 기간에 따라 소재가 갈라질 수 있습니다만, 이는 재질 특성에 따라 나타나는 것으로 불량이 아닙니다.사용하기 전 반드시 취급 주의사항 내용을 숙지해 주시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/10/[9300000002356]_20201013112259393.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000002520','악세서리','코르크 헤리티지 파우치','Cork heritage pouch',null,null,null,null,null,null,null,'N','Y',26000,null,null,null,null,null,null,'N','나무껍질을 활용한 코르크와 재생 가죽으로 제작된 비거니즘 상품으로, A5 사이즈의 다용도 파우치입니다.','코르크와 재생 가죽을 활용한 가로 230 * 세로 160 (mm) 사이즈의 파우치로 심플하면서도 감각적인 디자인이 돋보이는 상품입니다.A5 사이즈의 책 또는 플래너뿐 아니라 다양한 소품을 수납할 수 있으며, 스타벅스를 상징하는 그린 컬러의 재생 가죽 스트랩이 있어 휴대 시 용이합니다.또한 골드의 사이렌 로고가 지퍼 손잡이에 달려있어 고급스러운 분위기를 자아냅니다.변형 및 변색이 발생할 수 있으니 세탁 및 다림질은 피하시고, 오염 시 마른 수건으로 부드럽게 톡톡 닦아주시기 바랍니다.코르크 원단 특성상 사용감이 많을수록 빈티지해지는 경향이 있습니다. 헝겊을 사용하여 자연스럽게 닦아내시면 되며, 자연스러운 빈티지함을 원하신다면 개인의 취향에 따라 연출이 가능합니다.사용하기 전 반드시 취급 주의사항 내용을 숙지해 주시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/10/[9300000002520]_20201013112614413.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000002747','커피 용품','20 홀리데이 베리 티 캐니스터','20 Holiday berry tea canister',null,null,null,null,null,null,null,'Y','Y',28000,null,null,null,null,null,null,'N','세라믹 재질의 캐니스터로, 소중한 이들과 함께하는 연말 홈 파티를 특별하게 완성시켜줄 2020 크리스마스1 프로모션 상품입니다.','원두, 찻잎 등을 담을 수 있는 세라믹 소재의 캐니스터입니다. 127 * 127 *  133 (mm)의 넉넉한 사이즈이며, 리드에 실리콘 개스킷이 있어 내부 공기 차단 및 파손을 방지합니다. 본 상품은 전자레인지 사용이 불가하며 사용하기 전, 반드시 취급 주의사항 내용을 숙지해 주시기 바랍니다. *실리콘 개스킷은 닫는 방향에 따라 들뜸현상이 나타날 수 있으니 각도를 맞춰 사용해 주시기 바랍니다. ',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2020/10/[9300000002747]_20201021131342406.jpg');
