Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P11079035','커피 용품','리저브 블랙 캐니스터','Reserve black canister','TC03',null,null,null,null,null,null,'N','Y',39000,null,null,null,null,null,null,'N','스타벅스 리저브™ 매장 전용 상품','나무 리드와 세라믹 소재의 본체로 제작된 커피 캐니스터입니다. 리드와 본체 사이에는 실리콘 링이 포함되어 있어 공기의 유입을 막아주는 역할을 합니다.스타벅스 리저브 브랜딩이 되어 있으며, 250g의 원두 1봉지를 넣어 사용하기에 알맞은 사이즈입니다.* 스타벅스 리저브™ 매장에 한하여 판매됩니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2018/08/[11079035]_20180806095107456.jpg');
