Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P11028807','커피 용품','클래식 푸어 오버 콘 드리퍼','Classic pour over cone dripper',null,null,null,null,null,null,null,'N','Y',18000,null,null,null,null,null,null,'N','커피를 드립 방식으로 내려 마실 때 사용하는는 세라믹 소재의 드리퍼 ','세라믹 소재의 푸어 오버 콘 드리퍼입니다. 클래식 푸어 오버 콘 드리퍼는 커피 추출구가 1개의 홀로 되어 있어 드립 초보자가 사용하기에 좋습니다. 1개의 홀 추출구 드리퍼는 항상 일관된 품질의 커피가 추출될 수 있도록 하는 장점이 있습니다. ',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2017/06/[11028807]_20170615184820658.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('P9300000002123','커피 용품','티바나 루비 레드 티 팟 473ml','Teavana ruby red tea pot 473ml',null,'TC10',null,null,null,null,null,'N','Y',33000,null,null,null,null,null,null,'N','Teavana bar 매장 전용 상품','스타벅스 리저브 로스터리에서 판매하고 있는 쉐입에 동양적이면서도 모던한 컬러로 재 탄생한 티 팟입니다. 스테인리스 스틸 티 거름망이 들어있어 티백이나 잎차 사용에 모두 용이합니다. 티를 따를 때에는 한 손으로 뚜껑을 잡고 다른 한 손으로 들어올려 주시기 바라며, 표면이 뜨거울 수 있으니 화상에 주의하시기 바랍니다. 티 팟 바디에는 리드와 맞물리는 홈이 있습니다. 뚜껑을 열고 닫을 때 참고하여 이용하시기 바랍니다.',null,null,null,null,'https://image.istarbucks.co.kr/upload/store/skuimg/2019/10/[9300000002123]_20191011095026484.jpg');
