Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('B11019855','원두','베란다 블렌드 250g','Veranda Blend™ 250g',null,null,null,'블론드 로스트',null,null,null,'N','Y',18000,null,null,null,null,null,null,'N','부드럽고 친근한 성향을 가진 은은한 블렌드입니다.','은은하고 부드러운 맛 Subtle & Mellow','특별히 선택한 고품질의 라틴 아메리카 원두 블렌드를 단시간 로스팅하면 부드러운 코코아의 섬세한 뉘앙스와 살짝 볶은 견과류 향이 살아납니다. 은은하고 달콤한 풍미가 살아있는 이 커피는 친구를 초대한 자리에 어울리는 유쾌하고 품위있는 분위기를 연출하는데 매우 잘 어울립니다. 차분하고 편안하게 즐길 수 있는 이 커피는 마치 베란다에 놓인 의자에 앉아 커피를 마시는 듯한 느낌을 줍니다. 지역과 마을에서 볼 수 있는 테라스의 이름을 딴 베란다 블렌드™는 맑은 날 좋은 친구와 마시기 가장 좋은 친근한 커피입니다.','은은하고 달콤한 부드러움','좋은 친구와 함께 보내는 맑은 날, 한가한 시간',null,'https://image.istarbucks.co.kr/upload/store/skuimg/2015/08/[11019855]_20150809120449047.jpg');
Insert into STARBUCKS.MENU (MENUCODE,CATEGORY,KORNAME,ENGNAME,THEME,LIMITED,LIMITEDSTORE,BEAN,VIA,ORIGAMI,OPTINDEX,NEWYN,SOLD,PRICE,ALLERGY,KAL,SUGARS,PROTEIN,NATRIUM,FAT,SEASON,DESCR,ADDDESCR,RSTDESCR,TASTINGNOTES,ENJOYWITH,ORIGIN,MENUIMAGE) values ('B11117588','원두','콜롬비아 핀카 라 레세르바','Colombia Finca La reserva',null,null,null,'미디엄 로스트',null,null,null,'N','Y',33000,null,null,null,null,null,null,'N','은은한 산미와 다크 초콜릿, 달콤한 견과류의 풍미','균형잡힌 부드러움 Balance & Mellow','콜롬비아 북부, 안데스 산맥의 끝자락에 위치한 라 레세르바 농장은 일반적인 커피 농장과는 큰 차이가 있습니다. 이 곳은 농장 전체 면적의 절반에 달하는 약 200헥타르가 ''자연보호구역''으로, 엽서의 그림처럼 다양한 식물과 새, 나비, 개구리뿐만 아니라 멸종위기종인 타이거캣도 목격될 만큼 자연환경이 잘 지켜지고 있습니다. 라 레세르바 커피는 한 모금 마셔보면 은은한 산미와 함께 쌉쌀한 다크 초콜릿의 풍미가 드러나고, 부드럽게 입 안에 남아있는 달콤한 견과류의 깔끔한 끝 맛을 즐길 수 있습니다.','은은한 산미와 다크 초콜릿, 달콤한 견과류의 풍미',null,'콜롬비아','https://image.istarbucks.co.kr/upload/store/skuimg/2020/08/[11117588]_20200820092645911.jpg');
